import React from 'react';
import './Menu.css';

const TITLE = <h1>JUATABOT</h1>;

function Menu() {
  return (
    <div class="menuColumn">
      {TITLE}
      <div class="contactInfo">
        <ContactLink link="https://instagram.com/juatabot"></ContactLink>
        <br></br>
        <MailToLink link="tan.hen@husky.neu.edu"></MailToLink>
      </div>
    </div>
  )
}

function ContactLink(props) {
  return (
    <a href={props.link} target="_blank" class="contact-link">{props.link}</a>
  )
}

function MailToLink(props) {
  const mailto = "mailto: " + props.link;
  return (
    <a href={mailto} target="_blank" class="contact-link">{props.link}</a>
  )
}

export default Menu;
